import React, { Component } from 'react';
import Google from './GoogleLogin.js';
import Facebook from './FacebookLogin.js'

class SignIn extends Component {
  constructor() {
    super();
    this.state = {  
      showModal: false
    };
    this.handleOpenModal = this.handleOpenModal.bind(this);
    this.handleCloseModal = this.handleCloseModal.bind(this);
 }

  handleOpenModal () {
    this.setState({ showModal: true });
  }
  
  handleCloseModal () {
    this.setState({ showModal: false });
  }
  
  render() {
    <div>
    <button type="button" className="btn btn-info btn-lg" data-toggle="modal" data-target="#myModal"
    onClick={this.handleOpenModal}>Open Modal</button>
    <div className="modal fade" id="myModal" role="dialog">
     <div className="modal-dialog">

  <div className="modal-content">
    <div className="modal-header">
      <button type="button" className="close" data-dismiss="modal">&times;</button>
      <h4 className="modal-title">Modal Header</h4>
    </div>
          <div className="modal-body">
             <p>Some text in the modal.</p>
              <Google />
              <Facebook />
            </div>
    <div className="modal-footer">
      <button type="button" className="btn btn-default" data-dismiss="modal">Close</button>
    </div>
  </div>
  
     </div>
     </div>
    {/* <ReactModal 
  isOpen={this.state.showModal}
  contentLabel="Minimal Modal Example"
>
 <button onClick={this.handleCloseModal}>Close Modal</button>
</ReactModal> */}
         <SignIn />
       </div>
    return (
    <div>
        <h1>Log In Modal</h1>
          
    </div>
    )
  } 
}
export default SignIn;
